import React from "react";
import styled from "styled-components";

const StyledLi = styled.li`
  width: 100%;
  list-style: none;
  display: flex;
  align-items: center;
  justify-content: space-around;
`;

const User = ({ userData }) => {
  const { address, _id, name, email, sex, avatar, age, __v } = userData;

  return (
    <StyledLi>
      <h1>{name}</h1>
    </StyledLi>
  );
};

export default User;
